import React from 'react';

const DataView = (props) => {
    return ( 
    <div>
        {
            props.dataViewVisible
            ?<div>
                <h1>dataview 
                    <br></br>
                    <br></br>
                    <br></br>
                    <br></br>
                    showing</h1>
            </div>
            :<div></div>
        }
    </div>
     );
}
 
export default DataView;
